                      <p className="text-xs text-gray-600 dark:text-gray-400">Google • Mutual connection</p>
                    </div>
                    <button className="px-2 py-1 bg-blue-100 text-blue-800 text-xs rounded hover:bg-blue-200 transition-colors">
                      Connect
                    </button>
                  </div>
                  <div className="flex items-center space-x-3">
                    <div className="w-8 h-8 bg-purple-500 rounded-full flex items-center justify-center text-white text-xs font-bold">
                      AD
                    </div>
                    <div className="flex-1">
                      <p className="text-sm font-medium">Alice Davis</p>
                      <p className="text-xs text-gray-600 dark:text-gray-400">Meta • 2nd degree</p>
                    </div>
                    <button className="px-2 py-1 bg-purple-100 text-purple-800 text-xs rounded hover:bg-purple-200 transition-colors">
                      Connect
                    </button>
                  </div>
                </div>
                <button 
                  onClick={() => {
                    setSelectedAI('career');
                    setAiChatOpen(true);
                    setChatMessages(prev => [...prev, {
                      type: 'ai',
                      specialist: 'career',
                      content: 'I can help you expand your professional network! Would you like me to suggest people to connect with based on your target companies?',
                      timestamp: new Date()
                    }]);
                  }}
                  className="w-full py-2 bg-purple-500 text-white rounded-lg hover:bg-purple-600 transition-colors">
                  Find More Connections
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  };

  return (
    <div className={`min-h-screen transition-all duration-300 ${
      darkMode 
        ? 'bg-gradient-to-br from-gray-900 via-gray-800 to-gray-900 text-white' 
        : 'bg-gradient-to-br from-blue-50 via-white to-purple-50 text-gray-900'
    } ${dyslexiaMode ? 'font-mono' : 'font-sans'}`}>
      <Navigation />

      <main className={`pt-20 pb-8 px-4 max-w-6xl mx-auto transition-all ${aiChatOpen ? 'mr-80' : ''}`}>
        {currentPage === 'builder' && <BuilderPage />}
        {currentPage === 'analytics' && <AnalyticsPage />}
        {currentPage === 'templates' && <TemplatesPage />}
        {currentPage === 'career' && <CareerPage />}
      </main>

      <AIChatSidebar />

      {/* Floating AI Button */}
      {!aiChatOpen && (
        <button
          onClick={() => setAiChatOpen(true)}
          className="fixed bottom-6 right-6 w-14 h-14 bg-gradient-to-r from-purple-500 to-pink-500 text-white rounded-full shadow-lg hover:shadow-xl transition-all flex items-center justify-center z-50 hover:scale-110"
        >
          <Sparkles className="w-6 h-6" />
        </button>
      )}
    </div>
  );
};

function App() {
  return (
    <div className="App">
      <ResumeBuilder />
    </div>
  );
}

export default App;
